import React from 'react'

const LoginPage = () => {
  return (
    <div>
        <h1>LoginPage</h1>
        <form>
            <input type='text'
            name= 'username'
            placeholder='Username'
            onChange={handleLoginChange}
             />
        </form>
        </div>
  )
}

export default LoginPage;
